    "frequency-of-update",ntt"value": "THIS DATA SET REPRESENTS THE FINAL VERSION
    OF CYCLE 1 STUDY UNIT BOUNDARIES THAT EXISTED AT THE END OF THE FIRST DECADE OF
    STUDY. THE COVERAGE UNDERWENT MANY CHANGES OVER THE YEARS AND WAS UPDATED WHENEVER
    THE STUDY-UNIT BOUNDARIES CHANGED OR WERE REFINED. THE CHANGES FELL INTO THESE BROAD
    CATEGORIES: 1) THE STUDY-UNIT BOUNDARIES CHANGED AS THE GEOGRAPHIC DEFINITION OF
    THE BOUNDARY CHANGED (FEATURES WERE ADDED OR DELETED); 2) THE DIGITAL BOUNDARIES
    WERE REFINED BY ACQUIRING MORE DETAILED SOURCE MATERIALS; AND 3) CHANGES IN THE
    NAWQA PROGRAM NECESSITATED REVAMPING OF THE STUDY-UNIT DEFINITIONS. WHERE A REVISED
    STUDY-UNIT BOUNDARY WAS SHARED WITH ANOTHER STUDY UNIT, IN GENERAL, A HIGHER RESOLUTION
    BOUNDARY TOOK PRECEDENCE OVER A LOWER RESOLUTION BOUNDARY AND THE MORE RECENT VERSION
